import React from 'react';
import Navbar from './Navbar';
import Home from './Home';
import Services from './Services';
import Footer from './Footer';
import '../styles/App.css';

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <Navbar />
        <Home />
        <Services />
        <Footer />
      </div>
    );
  }
}

export default App;
